exports=async function(url,bid,cid,options){const{send}=require("http"),clientOptions={...(options&&options.clientOptions)};stat("request");let response=await send(url,clientOptions);stat("request"),assertOK(response);let html=response.body;const jsonText=html.subRegex(/images:\s*\$\.parseJSON\(['"]([^)]+)['"]\)/);if(!jsonText)return null;const urls=JSON.parse(jsonText);response=await send("https://www.cangyuantu.cc/js/mhmain.js",clientOptions),assertOK(response);const js=response.body;let imgurl=js.subRegex(/ imgurl=['"]([^'"]+)['"]/);return imgurl||(imgurl="https://img.dubuxiaoyao.com:30020/"),{urls:urls.map(_=>imgurl+_)}};